import React from 'react'
import QuestionService from './QuestionService';

export default function ButtonGenerator(questions) {
    const buttons = () => {
        const row = [];
        // const totalQue = ([5,4,3,2,1]);
        for (var i = 1; i <= questions.length; i++) {
            // row.push(<p key={i}>{i}</p>);
            row.push(<button className="btn btn-primary m-2" style={{ width: '45px' }} key={i}>{i}</button>);
        }
        return row;
    };

    return (
        <div>
            {
                buttons(<QuestionService></QuestionService>)
            }
        </div>
    );
}
